import React from "react";

const movies = [
  {
    id: 1,
    name: "Shawshank Redemption",
  },
  {
    id: 2,
    name: "The Dark Knight",
  },
  {
    id: 3,
    name: "Fight Club",
  },
];

const List = () => {
  return (
    <div className="bg-secondary m-2 rounded p-1">
      {movies.map(movie => (
        <div className="bg-danger rounded m-2 p-1">
          <h4>{movie.name}</h4>
        </div>
      ))}
    </div>
  );
};

export default List;
